var numDifferentIntegers = function(word){
    let temp = ""
    let arr = []
    let lastArr = []
    for(i = 0 ; i<word.length ; i++){
        if(isNaN(parseInt(word[i]))){
            arr.push(temp)
            temp = ""
        }
        else{
            temp += word[i]
        }
    }
    arr.push(temp)
    for(i = 0 ; i<arr.length ; i++){
        if(isNaN(parseInt(arr[i]))){
        }
        else{
            lastArr.push(BigInt(arr[i]))
        }
    }
    let set = new Set(lastArr)    
    return set.size
}

